const Header = () => {
    return <div className="navbar">
        <div className="container">
            <div className="navbar-left">
                <a href="#">
                    <img src="../public/logo192.png" alt="Gajanan Mallik" />
                </a>
            </div>
        </div>
    </div>
}
export default Header;
